import React from 'react';

function Header() {
  return (
    <header>
      <nav>
        <h1>BARBOSA Mathias</h1>
        <ul>
          <li><a href="#about">Biographie</a></li>
          <li><a href="#projects">Projets</a></li>
          <li><a href="#contact">Contact</a></li>
          <li><a href="#cv">CV</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
